import sys
import os
import random
import string
import rsa

from Crypto.Cipher import AES

BLOCK_SIZE = 16

def pad_text(text):
    padding = BLOCK_SIZE - len(text) % BLOCK_SIZE
    return text + padding * chr(padding)

def encrypt_aes(text, key):
    text = pad_text(text)
    iv = ''.join(chr(random.randint(0, 0xFF)) for i in range(BLOCK_SIZE))
    cipher = AES.new(key, AES.MODE_CBC, iv)
    return iv + cipher.encrypt(text)

def encrypt_text(text, key):
    return rsa.encrypt(text, key)

def main():
    pub_key, priv_key = rsa.newkeys(2048)
    print('Public key:', pub_key.save_pkcs1().decode('utf-8'))
    print('Private key:', priv_key.save_pkcs1().decode('utf-8'))

    text = input('Enter text to encrypt: ').encode('utf-8')

    encrypted_text = encrypt_text(text, pub_key)
    print('Encrypted text:', encrypted_text.decode('utf-16'))

    decrypted_text = rsa.decrypt(encrypted_text, priv_key)
    print('Decrypted text:', decrypted_text.decode('utf-8'))

if __name__ == '__main__':
    main()

